import Link from 'next/link';

const Test = () => {
    return (
        <Link href={`/post?title=${props.title}`} as={`/post/${props.title}`}>
            <a>Testing link</a>
        </Link>

    );
}

Test.getInitialProps = async function(props) {
    let title = "testing";
    return {
        title
    };
} 

export default Test;
